import React, { Component } from "react";
import "./Landing.css";
import Menu from "../Menu_Bar/menu";
import Floating_button from "./footer/Join_Bts";


class Landing extends Component {
  render() {
    return (
      <div id="body">
        <div id="main">
          <div id="container">
            <div id="header">
            
              <Menu />
            </div>
          </div>
          <Floating_button />
        </div>
        
      </div>
    );
  }
}

export default Landing;
